import './Sidebar.scss';
import {Link} from "react-router-dom";
import Logo from "./Logo";

const Sidebar = (props) => {
	return (
		<div>
			<Logo />
			<img src="../../src/assets/images/Logo.png"/>
			<ul>
				<li>
					<Link to="/">Main page</Link>
				</li>
			</ul>
		</div>
	)
}

export default Sidebar;
